css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("http://hhbgate.bonn.de/") {
    body	{
		background: #5EAAFA url(data:image/png;base64,) repeat-x scroll 0 0 !important;
    }
    img:nth-child(1)	{
		height: 0 !important;
		width: 0 !important;
		/* these numbers match the new image's dimensions */
		padding-left: 128px !important;
		padding-top: 128px !important;
		background: url(data:image/png;base64,) no-repeat !important;
	}
	.notice	{
		border: 0px solid black !important;
		text-shadow:  2px 2px 2px black !important;
		color: white !important;
		background: transparent url(data:image/png;base64,) no-repeat scroll 0 0 !important;
		padding-left: 80px !important;
		height: 50px !important;
	}
	h2	{
		color: white !important;
		text-shadow: 2px 2px 2px black !important;
	}
	small 	{
		color: transparent !important;
	}
	a.special	{
		-moz-box-shadow: 4px 4px 10px black;
		-moz-border-radius: 7px;
	}
}
